import React from 'react';
import sunny from './Assets/images/Sunny.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={sunny} className="App-logo" alt="logo" />
        <h1><u>OJO</u></h1>
        <p>
          Dress Ahead !
        </p>

      </header>
    </div>
  );
}

export default App;
